import React from 'react';
import icon from '../../assets/pix-icon.svg';

const PiXIcon = (props: any) => (
  <div className="PiXIcon-Component" onClick={props.click}>
    <img className="PiX-Icon" src={icon} alt="icon"/>
  </div>
);

export default PiXIcon;
